'''
双指针
注意的就是 小心index s会超过 所以用while的时候 要加一个s的限制条件
因为有可能s已经满足了 但t还有很多字符 会一直去比较 有可能out of range
'''

class Solution(object):
    def isSubsequence(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        if s == "":
            return True
        s_point, t_point = 0, 0
        while t_point < len(t) and s_point < len(s):
            if s[s_point] == t[t_point]:
                s_point += 1
            t_point += 1
        if s_point == len(s):
            return True
        return False
if __name__ == "__main__":
    solution = Solution()
    print(solution.isSubsequence("leeeeetcode",""))